import React from "react";

function MenuItem({ image, name, position }) {
    return (
        <div className="menuItem">
            <div style={{ backgroundImage: `url(${image})` }}> </div>
            <h2> {name} </h2>
            <h2> {position} </h2>
        </div>
    );
}

export default MenuItem;
